// frontend/src/components/InteractionHistory.jsx
import React from 'react';
import './InteractionHistory.css';

const InteractionHistory = ({ events = [], onClear, onGenerateReport, readyState }) => {
  const getStatusPill = () => {
    switch (readyState) {
      case 0: // CONNECTING
        return <span className="pill pill-status-connecting">连接中...</span>;
      case 1: // OPEN
        return <span className="pill pill-status-open">已连接</span>;
      case 2: // CLOSING
        return <span className="pill pill-status-closing">断开中...</span>;
      case 3: // CLOSED
        return <span className="pill pill-status-closed">服务不可用</span>;
      default:
        return <span className="pill pill-status-closed">服务不可用</span>;
    }
  };

  const renderEvent = (event) => {
    if (!event) {
      return <p>无事件数据</p>;
    }

    const { type, payload, title, timestamp } = event;
    const time = timestamp ? new Date(timestamp).toLocaleTimeString() : '无时间戳';

    switch (type) {
      case 'agent_message':
        return (
          <div className="p-2 bg-blue-100 rounded">
            <p className="font-bold">{title || '智能体消息'}</p>
            <p>{payload}</p>
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
      case 'agent_response':
        return (
          <div className="p-2 bg-green-100 rounded">
            <p className="font-bold">{title || '智能体响应'}</p>
            <p><strong>智能体:</strong> {payload.agent}</p>
            <p><strong>结果:</strong> {payload.result}</p>
            {payload.triggered_by && <p><strong>触发者:</strong> {payload.triggered_by}</p>}
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
      case 'analysis_report':
        return (
          <div className="p-2 bg-purple-100 rounded">
            <p className="font-bold">{title || '分析报告'}</p>
            <pre className="whitespace-pre-wrap">{payload.report}</pre>
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
      case 'traffic_incident':
        return (
          <div className="p-2 bg-yellow-100 rounded">
            <p className="font-bold">交通事件报告</p>
            <p>位置: {payload.location}</p>
            <p>描述: {payload.description}</p>
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
      case 'error':
        return (
          <div className="p-2 bg-red-100 rounded">
            <p className="font-bold">错误</p>
            <p>{payload}</p>
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
      case 'ping':
        return null; // 不显示ping消息
      default:
        return (
          <div className="p-2 bg-gray-100 rounded">
            <p className="font-bold">未知事件: {type}</p>
            <pre className="whitespace-pre-wrap">{JSON.stringify(payload, null, 2)}</pre>
            <p className="text-xs text-gray-500">{time}</p>
          </div>
        );
    }
  };

  return (
    <div className="interaction-record card">
      <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
        <h2 className="card__title">交互记录</h2>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          {getStatusPill()}
          <button onClick={onGenerateReport} className="generate-btn" style={{ marginLeft: '1rem' }}>生成报告</button>
          <button onClick={onClear} className="clear-btn" style={{ marginLeft: '1rem' }}>清空记录</button>
        </div>
      </div>
      <div className="history-scroll">
        {events.length === 0 ? (
          <p className="muted">暂无记录。发送模块以查看交互历史。</p>
        ) : (
          <ul className="history">
            {events.map((event, index) => (
              <li key={`${event.type}-${event.timestamp || index}-${index}`}>{renderEvent(event)}</li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default InteractionHistory;
